int Node_outputs_lookup_string(PointerRNA *ptr, const char *key, PointerRNA *r_ptr)
{
    extern int NodeSocket_name_length(PointerRNA *);
    extern void NodeSocket_name_get(PointerRNA *, char *);

    bool found = false;
    CollectionPropertyIterator iter;
    char namebuf[1024];
    char *name;

    Node_outputs_begin(&iter, ptr);

    while (iter.valid) {
        if (iter.ptr.data) {
            int namelen = NodeSocket_name_length(&iter.ptr);
            if (namelen < 1024) {
                NodeSocket_name_get(&iter.ptr, namebuf);
                if (strcmp(namebuf, key) == 0) {
                    found = true;
                    *r_ptr = iter.ptr;
                    break;
                }
            }
            else {
                name = MEM_mallocN(namelen+1, "name string");
                NodeSocket_name_get(&iter.ptr, name);
                if (strcmp(name, key) == 0) {
                    MEM_freeN(name);

                    found = true;
                    *r_ptr = iter.ptr;
                    break;
                }
                else {
                    MEM_freeN(name);
                }
            }
        }
        Node_outputs_next(&iter);
    }
    Node_outputs_end(&iter);

    return found;
}

